import React from "react";

class Search extends React.Component {

    state = {
        search: '',
    }

    render() {
        return <div className="row">

                <div className="input-field">
                    <input
                        placeholder='search'
                        type="search"
                        className="validate"
                        value={this.state.search}
                        onChange={(e) => this.setState({search: e.target.value})}
                    />
                </div>
        </div>
    }
}

export {Search}
